import React from 'react';
import { useState } from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import Textfield from '@material-ui/core/TextField';
import FormControlLabel from '@material-ui/core/FormControlLabel';
import Checkbox from '@material-ui/core/Checkbox';
import Link from '@material-ui/core/Link';
import Grid from '@material-ui/core/Grid';
import Box from '@material-ui/core/Box';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import { useHistory } from 'react-router-dom';
import axios from 'axios';
/* import styles from "./styles.module.css"; */
import Swal from 'sweetalert2';
import 'sweetalert2/dist/sweetalert2.min.css';
import {TextField, FormControl, InputLabel, Select, MenuItem } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  paper: {
    marginTop: theme.spacing(8),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  avatar: {
    margin: theme.spacing(1),
    backgroundColor: theme.palette.secondary.main,
  },
  form: {
    width: '100%', // Fix IE 11 issue.
    marginTop: theme.spacing(3),
  },
  submit: {
    margin: theme.spacing(3, 0, 2),
  },
}));

export default function SignUp() {

  const classes = useStyles();

  const history = useHistory();

  // Estado para los nuevos atributos
  const [identification, setIdentification] = useState('');
  const [name, setName] = useState('');
  const [lastname, setLastname] = useState('');
    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');
  const [phone, setPhone] = useState('');
  const [birthday, setBirthday] = useState('');
  const [gender, setGender] = useState('');
  const [province, setProvince] = useState('');
  const [canton, setCanton] = useState('');
  const [distrit, setDistrit] = useState(''); 


  const handleSubmit = async(e) => {



    axios.post('http://localhost:3001/register' , {name,lastname, email, password,identification,phone,birthday,gender,province,canton,distrit})
    .then(result => {console.log(result);
      if (result.data === "Usuario creado") {
        history.push('/SignIn/signin');
        Swal.fire({
          title: 'Exitoso',
          text: 'Agregado exitosamente',
          icon: 'success'
      });
    }else if (result.data === "Hay campos vacios") {
                Swal.fire({
                    title: 'Error',
                    text: 'Por favor llene todos los campos',
                    icon: 'error'
                });


              }else if (result.data === "El correo y la identificación ya existen") {
                Swal.fire({
                    title: 'Error',
                    text: 'Ya un usuario existe con este correo y identificacion!',
                    icon: 'error'
                });


              }else if (result.data === "El correo ya existe") {
                Swal.fire({
                    title: 'Error',
                    text: 'Ya un usuario existe con este correo!',
                    icon: 'error'
                });


              }else if (result.data === "La identificación ya existe") {
                Swal.fire({
                    title: 'Error',
                    text: 'Ya un usuario existe con esta identificacion!',
                    icon: 'error'
                });
              }

    })
    .catch(err=> console.log(err)) 


    // Aquí puedes implementar la lógica para procesar el inicio de sesión
    // Puedes enviar los datos (nombre, correo, contrasena) a tu servidor para autenticación.
};


  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
        <Avatar className={classes.avatar}></Avatar>
        <Typography component="h1" variant="h5">
          Registrarse
        </Typography>
        <form onSubmit={handleSubmit} className={classes.form} noValidate>
          <Grid container spacing={2}>
          <Grid item xs={12}>
              <Textfield
                variant="outlined"
                fullWidth
                id="identification"
                label="Número de Identificación"
                onChange = {(e) => setIdentification(e.target.value)}
                name="identification"
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <Textfield
                autoComplete="fname"
                name="firstName"
                variant="outlined"
                required
                fullWidth
                id="firstName"
                label="Primer Nombre"
                onChange = {(e) => setName(e.target.value)}
                autoFocus
              />
            </Grid>
            <Grid item xs={12} sm={6}>
              <Textfield
                variant="outlined"
                required
                fullWidth
                id="lastName"
                label="Apellido"
                name="lastName"
                onChange = {(e) => setLastname(e.target.value)}
                autoComplete="lname"
              />
            </Grid>
            <Grid item xs={12}>
              <Textfield
                variant="outlined"
                required
                fullWidth
                id="email"
                label="Correo"
                name="email"
                onChange = {(e) => setEmail(e.target.value)}
                autoComplete="email"
              />
            </Grid>
            <Grid item xs={12}>
              <Textfield
                variant="outlined"
                required
                fullWidth
                name="password"
                label="Contraseña"
                type="password"
                id="password"
                onChange = {(e) => setPassword(e.target.value)}
                autoComplete="current-password"

              />
            </Grid>
            <Grid item xs={12}>
              <Textfield
                variant="outlined"
                fullWidth
                id="phone"
                label="Número de Teléfono"
                onChange = {(e) => setPhone(e.target.value)}
                name="phone"
              />
            </Grid>
            <Grid item xs={12}>
              <Textfield
                variant="outlined"
                type="date"
                fullWidth
                id="birthday"
                label="Fecha de Nacimiento"
                InputLabelProps={{
                  shrink: true,
                }}
                onChange={(e) => setBirthday(e.target.value)}
                name="birthday"
              />
            </Grid>
            <Grid item xs={12}>
  <FormControl variant="outlined" fullWidth>
    <InputLabel id="gender-label">Género</InputLabel>
    <Select
      labelId="gender-label"
      id="gender"
      value={gender}
      onChange={(e) => setGender(e.target.value)}
      label="Género"
    >
      <MenuItem value="">No especificar</MenuItem>
      <MenuItem value="Masculino">Masculino</MenuItem>
      <MenuItem value="Femenino">Femenino</MenuItem>
    </Select>
  </FormControl>
</Grid>
            <Grid item xs={12}>
              <Textfield
                variant="outlined"
                fullWidth
                id="province"
                label="Provincia"
                onChange = {(e) => setProvince(e.target.value)}
                name="province"
              />
            </Grid>
            <Grid item xs={12}>
              <Textfield
                variant="outlined"
                fullWidth
                id="canton"
                label="Cantón"
                onChange = {(e) => setCanton(e.target.value)}
                name="canton"
              />
            </Grid>
            <Grid item xs={12}>
              <Textfield
                variant="outlined"
                fullWidth
                id="distrit"
                label="Distrito"
                onChange = {(e) => setDistrit(e.target.value)}
                name="distrit"
              />
            </Grid>
            {/* Fin de los nuevos campos */}
            <Grid item xs={12}>
              <FormControlLabel
                control={<Checkbox value="allowExtraEmails" color="primary" />}
                label="Me gustaría recibir promociones por correo."
              />
            </Grid>
          </Grid>
          {/* {error && <div className={styles.error_msg}>{error}</div>} */}
          <Button
            onClick={handleSubmit}
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
          >
            Registrarse
          </Button>
          <Grid container justifyContent="flex-end">
            <Grid item>
              <Link href="/SignIn/signIn" variant="body2">
                ¿Ya tiene una cuenta? Inicia Sesión
              </Link>
            </Grid>
          </Grid>
        </form>
      </div>
      <Box mt={6}></Box>
    </Container>
  );
}
